import React from 'react';
import Link from 'next/link'
import '../src/styles.module.css'

const Page = () => (
  <div>
    <h1> Index Page</h1>
    <Link href="/notes">
      <a>Notes</a>
    </Link>
  </div>
)

export default Page;
